import React, { useState } from 'react';

function SignUp() {
  const [contact, setContact] = useState({
    firstName: "",
    email: "",
    password:""
  });

  function handleChange(event){
    const { name, value } = event.target;

    setContact(prevValue => {
      if(name === "firstName") {
        return {
          firstName: value,
          password: prevValue.password,
          email: prevValue.email
        };
      } else if ( name === "password"){
        return {
          firstName: prevValue.firstName,
          password: value,
          email: prevValue.email
        };
      } else if ( name === "email"){
        return {
          firstName: prevValue.firstName,
          password: prevValue.password,
          email: value
        };
      }
    });
  }

  return (
      <div className="container">
        <h1>
          Welcome Back. {contact.firstName} {contact.lastName}
        </h1>

        <p>{contact.email}</p>
        <form>
          <input onChange={handleChange} value={contact.firstName} name="firstName" placeholder="First Name" />
          <input onChange={handleChange} value={contact.email} name="email" placeholder="Email" />
          <button>Submit</button>
        </form>
      </div>
  );
}

export default SignUp;
